import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import PlayerPicksPage from './components/PlayerPicksPage';
import ResultsPage from './components/ResultsPage';
import PrintablePage from './components/PrintablePage';
import AdminUploadPage from './components/AdminUploadPage';
import AdminApproveGamesPage from './components/AdminApproveGamesPage';

function App() {
  return (
    <Router>
      <div style={{ padding: '20px' }}>
        <nav>
          <Link to="/picks/week/1">Player Picks</Link> |{' '}
          <Link to="/results/week/1">Results</Link> |{' '}
          <Link to="/print/week/1">Printable</Link> |{' '}
          <Link to="/admin-upload">Upload Games</Link> |{' '}
          <Link to="/admin-approve">Approve Games</Link>
        </nav>

        <Routes>
          <Route path="/picks/week/:week" element={<PlayerPicksPage />} />
          <Route path="/results/week/:week" element={<ResultsPage />} />
          <Route path="/print/week/:week" element={<PrintablePage />} />
          <Route path="/admin-upload" element={<AdminUploadPage />} />
          <Route path="/admin-approve" element={<AdminApproveGamesPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
